 rel="canonical" href="https://en.wikipedia.org/wiki/Fang"/> <link rel="dns-prefetch" href="//login.wikimedia.org"/> <link rel="dns-prefetch" href="//meta.wikimedia.org" /> <!--[if lt IE 9]><script src="/w/load.php?debug=false&amp;lang=en&amp;modules=html5shiv&amp;only=scripts&amp;skin=vector&amp;sync=1"></script><![endif]--> </head> <body class="mediawiki ltr sitedir-ltr mw-hide-empty-elt ns-0 ns-subject page-Fang rootpage-Fang skin-vector action-view">		<div id="mw-page-base" class="noprint"></div> 		<div id="mw-head-base" class="noprint"></div> 		<div id="content" class="mw-body" role="main"> 			<a id="top"></a> 			<div id="siteNotice" class="mw-body-content"><!-- CentralNotice --></div><div class="mw-indicators mw-body-content"> </div> <h1 id="firstHeading" class="firstHeading" lang="en">Fang</h1>			<div id="bodyContent" class="mw-body-content"> 				<div id="siteSub" class="noprint">From Wikipedia, the free encyclopedia</div>				<div id="contentSub"></div> 								<div id="jump-to-nav" class="mw-jump"> 					Jump to:					<a href="#mw-head">navigation</a>, 					<a href="#p-search">search</a> 				</div> 				<div id="mw-content-text" lang="en" dir="ltr" class="mw-content-ltr"><div class="mw-parser-output"><div class="thumb tright"> <div class="thumbinner" style="width:222px;"><a href="/wiki/File:Fangs_01_rfc1036.jpg" class="image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Fangs_01_rfc1036.jpg/220px-Fangs_01_rfc1036.jpg" width="220" height="165" class="thumbimage" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Fangs_01_rfc1036.jpg/330px-Fangs_01_rfc1036.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Fangs_01_rfc1036.jpg/440px-Fangs_01_rfc1036.jpg 2x" data-file-width="2848" data-file-height="2136" /></a> <div class="thumbcaption"> <div class="magnify"><a href="/wiki/File:Fangs_01_rfc1036.jpg" class="internal" title="Enlarge"></a></div> The four <a href="/wiki/Canine_tooth" title="Canine tooth">canines</a>, or fangs, of a domestic <a href="/wiki/Cat" title="Cat">cat</a>. (The largest two teeth of the top and bottom rows of teeth.)</div> </div> </div> <div role="note" class="hatnote navigation-not-searchable">For other uses, see <a href="/wiki/Fang_(disambiguation)" class="mw-disambig" title="Fang (disambiguation)">Fang (disambiguation)</a>.</div> <p>A <b>fang</b> is a long, pointed <a href="/wiki/Tooth" title="Tooth">tooth</a>. <sup id="cite_ref-1" class="reference"><a href="#cite_note-1">[1]</a></sup> In <a href="/wiki/Mammals" class="mw-redirect" title="Mammals">mammals</a>, a fang is a modified <a href="/w/index.php?title=Maxillary_tooth&amp;action=edit&amp;redlink=1" class="new" title="Maxillary tooth (page does not exist)">maxillary tooth</a>, used for biting and tearing flesh. In <a href="/wiki/Snakes" class="mw-redirect" title="Snakes">snakes</a>, it is a venom-injecting tooth (see <a href="/wiki/Snake_venom" title="Snake venom">snake venom</a>). <a href="/wiki/Spider" title="Spider">Spiders</a> also have external <a href="/wiki/Cheliceral_fang" class="mw-redirect" title="Cheliceral fang">fangs</a>, which are part of the <a href="/wiki/Chelicerae" title="Chelicerae">chelicerae</a>.</p> <p>Fangs are most common in carnivores or omnivores, but some herbivores, such as <a href="/wiki/Fruit_bat" class="mw-redirect" title="Fruit bat">fruit bats</a>, have them as well. They are generally used to hold or swiftly kill prey, such as in large cats. Omnivorous animals, such as <a href="/wiki/Bear" title="Bear">bears</a>, use their fangs when hunting fish or other prey, but they are not needed for consuming fruit. Some apes also have fangs, which they use for threats and fighting. However, the relatively short canines of humans are not considered to be fangs.</p> <p></p> <div id="toc" class="toc"> <div class="toctitle"> <h2>Contents</h2> </div> <ul> <li class="toclevel-1 tocsection-1"><a href="#Fangs_in_religion,_mythology_and_legend"><span class="tocnumber">1</span> <span class="toctext">Fangs in religion, mythology and legend</span></a></li> <li class="toclevel-1 tocsection-2"><a href="#See_also"><span class="tocnumber">2</span> <span class="toctext">See also</span></a></li> <li class="toclevel-1 tocsection-3"><a href="#References"><span class="tocnumber">3</span> <span class="toctext">References</span></a></li> <li class="toclevel-1 tocsection-4"><a href="#External_links"><span class="tocnumber">4</span> <span class="toctext">External links</span></a></li> </ul> </div> <p></p> <h2><span id="Fangs_in_religion.2C_mythology_and_legend"></span><span class="mw-headline" id="Fangs_in_religion,_mythology_and_legend">Fangs in religion, mythology and legend</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Fang&amp;action=edit&amp;section=1" title="Edit section: Fangs in religion, mythology and legend">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <p>Certain mythological and legendary creatures such as <a href="/wiki/Dragon" title="Dragon">dragons</a>, <a href="/wiki/Gargoyle" title="Gargoyle">gargoyles</a> and <a href="/wiki/Yaksha" title="Yaksha">yakshas</a> are commonly depicted with prominent fangs. The fangs of <a href="/wiki/Vampire" title="Vampire">vampires</a> are one of their defining characteristics.</p> <p>The iconographic representation of some Hindu deities include fangs, to symbolize the ability to hunt and kill. Two examples are fierce warrior goddess <a href="/wiki/Chamunda" title="Chamunda">Chamunda</a> and god of death <a href="/wiki/Yama" title="Yama">Yama</a> in some iconographic representations. Fangs are also common among guardian figures such as Verupaksha in Buddhism art in China and East Asia,<sup id="cite_ref-2" class="reference"><a href="#cite_note-2">[2]</a></sup> as well as <a href="/wiki/Rangda" title="Rangda">Rangda</a> in Balinese <a href="/wiki/Hinduism" title="Hinduism">Hinduism</a>.<sup id="cite_ref-3" class="reference"><a href="#cite_note-3">[3]</a></sup></p> <table> <tr valign="top"> <td> <div class="thumb tright"> <div class="thumbinner" style="width:152px;"><a href="/wiki/File:Halloween95_Showing_my_fangs.jpg" class="image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/2/27/Halloween95_Showing_my_fangs.jpg/150px-Halloween95_Showing_my_fangs.jpg" width="150" height="176" class="thumbimage" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/2/27/Halloween95_Showing_my_fangs.jpg/225px-Halloween95_Showing_my_fangs.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/2/27/Halloween95_Showing_my_fangs.jpg/300px-Halloween95_Showing_my_fangs.jpg 2x" data-file-width="681" data-file-height="800" /></a> <div class="thumbcaption"> <div class="magnify"><a href="/wiki/File:Halloween95_Showing_my_fangs.jpg" class="internal" title="Enlarge"></a></div> Vampire fangs</div> </div> </div> </td> <td> <div class="thumb tright"> <div class="thumbinner" style="width:142px;"><a href="/wiki/File:The_deity_Yama_with_fangs_and_holding_a_da%E1%B9%87%E1%B8%8Da_(a_rod).jpg" class="image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/b/bb/The_deity_Yama_with_fangs_and_holding_a_da%E1%B9%87%E1%B8%8Da_%28a_rod%29.jpg/140px-The_deity_Yama_with_fangs_and_holding_a_da%E1%B9%87%E1%B8%8Da_%28a_rod%29.jpg" width="140" height="180" class="thumbimage" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/b/bb/The_deity_Yama_with_fangs_and_holding_a_da%E1%B9%87%E1%B8%8Da_%28a_rod%29.jpg/210px-The_deity_Yama_with_fangs_and_holding_a_da%E1%B9%87%E1%B8%8Da_%28a_rod%29.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/b/bb/The_deity_Yama_with_fangs_and_holding_a_da%E1%B9%87%E1%B8%8Da_%28a_rod%29.jpg/280px-The_deity_Yama_with_fangs_and_holding_a_da%E1%B9%87%E1%B8%8Da_%28a_rod%29.jpg 2x" data-file-width="595" data-file-height="767" /></a> <div class="thumbcaption"> <div class="magnify"><a href="/wiki/File:The_deity_Yama_with_fangs_and_holding_a_da%E1%B9%87%E1%B8%8Da_(a_rod).jpg" class="internal" title="Enlarge"></a></div> Hindu god of death <a href="/wiki/Yama" title="Yama">Yama</a> with fangs</div> </div> </div> </td> <td> <div class="thumb tright"> <div class="thumbinner" style="width:112px;"><a href="/wiki/File:The_Hindu_deity_Chamunda_-_Indian_Art_-_Asian_Art_Museum_of_San_Francisco.jpg" class="image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/4/4c/The_Hindu_deity_Chamunda_-_Indian_Art_-_Asian_Art_Museum_of_San_Francisco.jpg/110px-The_Hindu_deity_Chamunda_-_Indian_Art_-_Asian_Art_Museum_of_San_Francisco.jpg" width="110" height="165" class="thumbimage" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/4/4c/The_Hindu_deity_Chamunda_-_Indian_Art_-_Asian_Art_Museum_of_San_Francisco.jpg/165px-The_Hindu_deity_Chamunda_-_Indian_Art_-_Asian_Art_Museum_of_San_Francisco.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/4/4c/The_Hindu_deity_Chamunda_-_Indian_Art_-_Asian_Art_Museum_of_San_Francisco.jpg/220px-The_Hindu_deity_Chamunda_-_Indian_Art_-_Asian_Art_Museum_of_San_Francisco.jpg 2x" data-file-width="1367" data-file-height="2048" /></a> <div class="thumbcaption"> <div class="magnify"><a href="/wiki/File:The_Hindu_deity_Chamunda_-_Indian_Art_-_Asian_Art_Museum_of_San_Francisco.jpg" class="internal" title="Enlarge"></a></div> Hindu warrior goddess <a href="/wiki/Chamunda" title="Chamunda">Chamunda</a>.</div> </div> </div> </td> <td> <div class="thumb tright"> <div class="thumbinner" style="width:132px;"><a href="/wiki/File:Here_be_Dragons%5E_-_geograph.org.uk_-_503157.jpg" class="image"><img alt="" src="//upload.wikimedia.org/wikipedia/commons/thumb/2/24/Here_be_Dragons%5E_-_geograph.org.uk_-_503157.jpg/130px-Here_be_Dragons%5E_-_geograph.org.uk_-_503157.jpg" width="130" height="173" class="thumbimage" srcset="//upload.wikimedia.org/wikipedia/commons/thumb/2/24/Here_be_Dragons%5E_-_geograph.org.uk_-_503157.jpg/195px-Here_be_Dragons%5E_-_geograph.org.uk_-_503157.jpg 1.5x, //upload.wikimedia.org/wikipedia/commons/thumb/2/24/H